import React, { Component } from "react";
import "./main.scss";
import Toolbar from "./ToolBar/toolbar";
class MainUI extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="container">
        <div className="toolBar">
          <Toolbar />
        </div>
        <div className="verticalBreak"></div>
      </div>
    );
  }
}

export default MainUI;
